import React from "react";
import Link from 'next/link'

const Work = ({
  fileName,
  title,
  description,
  url,
}) => {
  return (
    <Link href={url}>
      <div className="bg-white rounded-lg feature-box rounded-lg m-4 mb-10 overflow-hidden">
        <div className="bg-sky h-32 overflow-hidden" style={{padding: "0 0 80% 0"}}>
          <img className="w-full self-center" src={fileName} />
        </div>
        <div className="z-10 bg-white p-6">
          <h3 className="text-2xl text-gray-700">{title}</h3>
          <p className="text-gray-600">{description}</p>
        </div>
      </div>
    </Link>
  );
};

export default Work;
